import React, { Component } from 'react';
import './index.css';

import Icons from './components/Layout/Icons/IconContainer';
import Signature from './components/Layout/Signature';
import Logo from './components/Layout/Logo';


export default 
class App extends Component {
  state = {
    pomodoro: false
  }

  render() {
    return (
      <div 
        style = {{
          height: '100vh',
          width: '100vw',
          background: 'linear-gradient(145deg, #090a0a 45%, #151617 75%)',
          color: 'white',
          display: 'flex',
          justifyContent: 'space-between'
        }}
      >
      <div style = {{
        display: 'flex',
        flexDirection: 'column',
        width: '50%',
        marginLeft: '5%',
        justifyContent: 'space-between',
      }}>
        <div style = {{
          display: 'flex',
          justifyContent: 'space-between',
          width: '100%',
          padding: '5%',
          position: 'relative'
        }}>
          <Icons />
        </div>
        <div>

        </div>
        <i class="fas fa-user-clock"></i>
      </div>
        <div style = {{
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'flex-end',
          alignItems: 'center'
        }}>
          <div style = {{
            height: '75vh',
          }}>
            <Logo />
          </div>
          <div style = {{
            width: '18vw',
            margin: '1%'
          }}>
            <Signature />
          </div>
        </div>
      </div>
    );
  }
}
